import React from "react";
import { Linke } from "react-router-dom";

function HomeButton(props) {
  const navigate = useNavigate();

  return (
    <div className={`${props.color} flex gap-2`}>
      <nav>
        <Link to={props.url}>
          <button>{props.value} </button>
        </Link>
      </nav>{" "}
      <span>|</span>
    </div>
  );
}

export default HomeButton;
